(1, 'OnePieceTC', 'https://onepiece-treasurecruise.com/wp-content/uploads/f2181.png', 'https://onepiece-treasurecruise.com/wp-content/uploads/c2181.png', 'Barbe Blanche et Marco', 'Barbe Blanche', 'Marco', 'Combat épique de la guerre au sommet\r\n', 'PSY', 'INT', 'Tenace', 'Tenace', 'Cogneur', 'Tenace', 'Ravageur', 'Tenace', 4, 4, 4, 3420, 3930, 3280, 3790, 2812, 3322, 1634, 1874, 1572, 1812, 1468, 1708, 428, 513, 261, 346, 398, 485, 'Multiplie l\'ATK des personnages de type PSY et INT par 4,25, multiplie l\'ATK des personnages de type STR, DEX et QCK par 3, multiplie la RCV de tous les personnages par 1,5, réduit les dégâts subis de 20% et rend les cercles PSY et INT avantageux pour tous les personnages.', 'Multiplie l\'ATK des personnages de type PSY par 3,5, multiplie l\'ATK des personnages de type STR, DEX, QCK et INT par 2,75, réduit les dégâts subis de 20% et rend les cercles PSY avantageux pour tous les personnages.', 'Multiplie l\'ATK des personnages de type INT par 3,5, multiplie l\'ATK des personnages de type STR, DEX, QCK et PSY par 2,75, multiplie la RCV de tous les personnages par 1,25 et rend les cercles INT avantageux pour tous les personnages.', 23, 18, 16, 'Enlève 30% des HP de chaque ennemi, restaure 20 000 HP, mélange les cercles de tous les personnages aléatoirement en cercles PSY, INT ou RCV et devient \"Barbe Blanche et Marco\" pendant 3 tours.', 'Ajoute 100 en HP, ATK et RCV pour les personnages de type PSY et INT.', 'Ajoute 75 en ATK pour les personnages de type PSY et INT.', 'Ajoute 75 en HP et RCV pour les personnages de type PSY et INT.', 'Réduit la durée de \"Paralysie\" et de \"Lien des coups spéciaux\" de tous les personnages d\'un tour, rend les cercles RCV avantageux pour tous les personnages pendant un tour et change son cercle en cercle RCV.', 'Immunise le personnage contre \"Paralysie\" et \"Lien des coups spéciaux\".', 'Réduit les dégâts subis par les ennemis de type PSY de 7%.', 'Réduit les dégâts subis par les ennemis de type INT de 7%.', 'Annule le “Lien des cercles” du personnage.', '', '');
