(1, 'OnePieceTC', 'https://onepiece-treasurecruise.com/wp-content/uploads/f2113.png', 'https://onepiece-treasurecruise.com/wp-content/uploads/c2113.png', 'Charlotte Dent-de-chien', 'G?n?ral sucr? de l\'?quipage de Big Mom', 'STR', 'Tireur', 'Intellectuel', '4', '3700', '4140', '1640', '1890', '250', '310', 'Multiplie l\'ATK des personnages de classe Cogneur, Ravageur, Tireur, Intellectuel et Tenace par 1,825 (par 3,33 pour les personnages qui ont 2 classes), r?duit les d?g?ts subis de 20%, rend les cercles QCK, PSY, RCV et TND avantageux pour tous les personn', '16', '11', '10', 'Multiplie l\'ATK contre les ennemis avec leurs attaques retard?es par 1,75 pour les personnages de classe Cogneur, Ravageur, Tireur, Intellectuel et Tenace pendant 2 tours, change les cercles de type et BLK des personnages de classe Cogneur, Ravageur, Tireur, Intellectuel et Tenace en cercles correspondants et r?duit le temps de chargement des coups sp?ciaux des personnages de classe Cogneur, Ravageur, Tireur, Intellectuel et Tenace d\'un tour.', 'Ajoute 50 en ATK pour les personnages de classe Cogneur, Ravageur, Tireur, Intellectuel et Tenace.', 'Multiplie l\'ATK du personnage par 2 contre les ennemis de type QCK.', 'R?duit les d?g?ts subis par les ennemis de type DEX de 7%.', 'R?duit la dur?e de ?Soin impossible? de 7 tours.', 'Si un coup \"PARFAIT\" est effectu? avec ce personnage, 90% de chances de faire 10% l\'ATK du personnage en d?g?ts additionnels.'),
