INSERT INTO `recherche` (`id`, `nom`, `gameid`, `commentaire`, `contact`) VALUES
(1, 'Exemple', 'Exemple', 'Exemple', 'Exemple'),
(66, 'Gromite', '934866280', 'Bonjour je recherche une équipe pour le futur combat d’amitié kidd.\r\n\r\nGromite lvl 450, il me manque actuellement 5 légendes pour être full.\r\n\r\nJ’ai pas mal de build d’équipes pour être compétitif sur l’évènement.', 'Gromite#3108 sur discord'),
(67, 'FayaMike', '075176382', 'Salut, je cherche une équipe pour le kizuna, j\'ai pas encore les booster, a voir si le sugo sera interessant ou non je vais ptetre pull. Je cherche pas forcement une equipe qui cherche un top mais au moins qui s\'investi dans l\'evenement pour faire avancer tout le monde ! Au vu des fiches des différents combats je n\'aurais aucune difficuté a aller assez loin avec mes legends.', 'FayaMik#2231 sur discord'),
(68, 'New World', '803 403 378', 'c\'est mon premier Kizuna en équipe, je suis motivé et actif et je cherche une team pour aller le plus loin possible', ''),
(69, 'TT-KSan', '098556331', 'Salut je recherche une team pour le kizuna objectif rang S\r\nJe suis level 531 et je dispose de 35 Potions\r\n', ''),
(70, 'Didodu91', '417476003', 'Bonjour je suis actif et motivé sur le jeu . J\'ai 26 potion et cherche à bien me classer .\r\nMerci de votre aide :)', ''),
(71, 'Alikyel', '735429345', 'Salut !\r\nJe suis à la recherche d\'une team ayant comme objectif le rang S et Plvl 448 ! Je vais faire des multis pour avoir quelques boosters. J\'ai également 29 potions pour ce kizuna.\r\nTrès motivé, n\'hésitez pas à me mp sur discord ', 'Alikyel#8129'),
(72, 'Zilld', '433453592', 'Je recherche une team pour arriver au rang S. \r\n\r\nPseudo: Zilld\r\nNiveau: 454\r\nPotions: 15', 'Discord: Franchipane#1751');
INSERT INTO `team` (`id`, `nomequipe`, `nom`, `invitation`, `commentaire`, `membre`, `contact`, `mdp`) VALUES
(1, 'Exemple', 'Exemple', 'Exemple', 'Exemple', 'Exemple', 'Exemple', 'test'),
(25, 'La Brigade Fantôme', 'ilix69', '', 'Salut, Je créé une Team qui a pour but d\'atteindre le Rang S dans ce kizuna.Je suis Pirate LVL 429 et j\'ai 20 potions kizuna. Si vous vous sentez prêt à aller jusque là je vous invite à me rejoindre ! \r\nIl faudrait au moins un Pirate LVL de 300+ et une dizaine de potions kizuna au minimum. Merci !', 'Sur Discord : (3/10) \r\n@ilix69#1473\r\n@Neji#2147\r\n', 'Envoyez moi un message privé sur discord @ilix69#1473', 'Phantomtroup69'),
(26, 'Le S ou rien', 'Goldenstars', '393387154', 'Bonjour à tous ! Je crée cette équipe pour pouvoir atteindre le S durant le prochain Kizuna. Je ne demande pas forcément d\'être dans le top 10 mais un minimum de performance quand même (de quoi être dans le top 10%). Mais n\'oublions pas que c\'est un jeu et qu\'on est la pour s\'amuser avant tout (mais aussi pour gagner un max de gemmes :D ) N\'hésiter pas à m\'ajouter sur discord pour discuter un peu plus.', 'COMPLET', 'Discord : Goldenstars#5660', 'X86Wjq');
