INSERT INTO `personnage` (`id`, `nom`, `capacite`, `obtention`, `image`, `telechargement`, `lien`, `target`) VALUES
(1, 'Canot', 'Multiplie les HP de tous les personnages par 1,3, ajoute 120 à la RCV du capitaine et rend le timing des coups “PARFAIT” légèrement plus facile pour tous les personnages.', 'Histoire', 'https://i.imgur.com/FgcKFSZ.png', 'FgcKFSZ', '0', 'Canot'),
(2, 'Vogue Merry', 'Multiplie l\'ATK de tous les personnages par 1,5, ajoute 300 aux HP du capitaine et rend le timing des coups “PARFAIT” plus facile pour tous les personnages.', 'Histoire', 'https://i.imgur.com/255i5p7.png', '255i5p7', '0', 'Vogue'),
(3, 'Navire de la marine', 'Multiplie les HP de tous les personnages par 1,5 et ajoute 100 à l\'ATK des personnages de classe Tireur.', 'Histoire', 'https://i.imgur.com/LYnT94N.png', 'LYnT94N', '0', 'Marine'),
(4, 'Baratie', 'Ajoute 2 000 aux HP du capitaine.', 'Histoire', 'https://i.imgur.com/RxltIVm.png', 'RxltIVm', '0', 'Baratie'),
(5, 'Barque mortuaire', 'Multiplie l\'ATK et les HP des personnages de classe Sabreur par 1,5 et réduit la RCV du capitaine de 700.', 'Foret', 'https://i.imgur.com/9dY1HAp.png', '9dY1HAp', 'https://onepiecetreasurecruise.fr/Foret/Faucon.html', 'Barque'),
(6, 'Miss Love Duck', 'Multiplie l\'ATK des personnages de classe Ravageur par 1,5, augmente légèrement les chances d\'apparition des cercles correspondants pour les personnages de classe Ravageur, ajoute 100 en ATK pour les personnages de classe Ravageur et réduit les dégâts subis de 10%.', 'Mission', 'https://i.imgur.com/XwGnNgK.png', 'XwGnNgK', '0', 'Duck'),
(7, '<small>Vogue Merry volant</small><br>Vogue Merry', 'Multiplie l\'ATK de tous les personnages par 1,2 et restaure 350 HP à la fin de chaque tour.', 'Histoire', 'https://i.imgur.com/WRaiOMy.png', 'WRaiOMy', '0', 'Volant'),
(8, 'Moby Dick', 'Multiplie l\'ATK de tous les personnages par 1,5, les HP par 1,4 et réduit les HP de l\'équipe de 50% au début de la quête.', 'Foret', 'https://i.imgur.com/yaRi1RY.png', 'yaRi1RY', 'https://onepiecetreasurecruise.fr/Foret/Barbe.html', 'Moby'),
(9, 'Big Top', 'Multiplie l\'ATK des personnages ayant un coût inférieur ou égal à 40 par 1,5 et les HP par 1,4.', 'Mission', 'https://i.imgur.com/yPKT1kr.png', 'yPKT1kr', '0', 'Baggy'),
(10, 'Bezan Black', 'Réduit le temps de chargement des coups spéciaux de tous les personnages d\'un tour au début de la quête, multiplie l\'ATK des personnages de type <b style=\'color:#4C4CFF\'>QCK</font></b> par 1,5 et les HP par 1,3.', 'Mission', 'https://i.imgur.com/TCd6MAM.png', 'TCd6MAM', '0', 'Bezan'),
(11, 'Vélo d\'Aokiji', 'Multiplie l\'ATK et les HP des personnages de classe Ravageur par 1,5 et réduit les chances d\'apparition des cercles <b style=\'color:#BC5C0C\'>[RCV]</b>.', 'Foret', 'https://i.imgur.com/tQ7jPNw.png', 'tQ7jPNw', 'https://onepiecetreasurecruise.fr/Foret/Faisan.html', 'Velo'),
(12, 'Striker', 'Réduit le temps de chargement des coups spéciaux des personnages de classe Tireur d\'un tour au début de la quête, multiplie l\'ATK des personnages de classe Tireur par 1,5 et les HP par 1,3.', 'Foret', 'https://i.imgur.com/SVXTkDQ.png', 'SVXTkDQ', 'https://onepiecetreasurecruise.fr/Foret/Poing_ardent.html', 'Striker'),
(13, 'Thousand Sunny', 'Multiplie l\'ATK de tous les personnages par 1,5.<br><br>Coup spécial (15 tours) : Inflige 50 000 points de dégâts non élémentaires sur tous les ennemis.', 'Histoire', 'https://i.imgur.com/meBZeey.png', 'meBZeey', '0', 'Sunny'),
(14, 'Dreadnaught Sabre', 'Multiplie les HP de tous les personnages par 1,5 et inflige 10 000 points de dégâts non élémentaires sur tous les ennemis à la fin de chaque tour.', 'Mission', 'https://i.imgur.com/iajvi3I.png', 'iajvi3I', '0', 'Dreadnaught'),
(15, 'Navire de l\'équipage des Kuja', 'Multiplie l\'ATK des personnages de classe Libre par 1,5, les HP par 1,35 et réduit les HP des personnages qui ne sont pas de classe Libre de 99%.<br><br>Coup spécial (15 tours) : Restaure 6 500 HP.', 'Foret', 'https://i.imgur.com/yjfBXOp.png', 'yjfBXOp', 'https://onepiecetreasurecruise.fr/Foret/Serpent.html', 'Kuja'),
(16, 'Arche Maxim', 'Multiplie l\'ATK des personnages de type <b style=\'color:#4C4CFF\'>QCK</font></b> et <b style=\'color:#ECAC04\'>PSY</font></b> par 1,5 et les HP par 1,2.<br><br>Coup spécial (17 tours) : Inflige 56 560 points de dégâts fixes sur tous les ennemis.', 'Foret', 'https://i.imgur.com/kxzfSaF.png', 'kxzfSaF', 'https://onepiecetreasurecruise.fr/Foret/Dieu.html', 'Arche'),
(17, 'Red Force', 'Multiplie l\'ATK des personnages de classe Intellectuel par 1,5, les HP par 1,35 et augmente les chances d\'apparition des cercles correspondants pour les personnages de classe Intellectuel.', 'Foret', 'https://i.imgur.com/nQ2BWa0.png', 'nQ2BWa0', 'https://onepiecetreasurecruise.fr/Foret/Le_Roux.html', 'Red'),
(18, '<small>Modèle spécial 2e anniversaire de Treasure Cruise</small><br>Thousand Sunny', 'Multiplie l\'ATK de tous les personnages par 1,2.<br><br>Pendant l\'événement : Multiplie l\'ATK de tous les personnages par 1,5 et jauges de chargement des coups spéciaux au maximum au début de la quête.', 'Evenement', 'https://i.imgur.com/ITrIGlB.png', 'ITrIGlB', '0', 'Anni'),
(19, 'Navire de l\'équipage des pirates du Soleil', 'Multiplie l\'ATK et les HP des personnages de classe Cogneur selon le nombre de personnages de classe Cogneur présents dans l\'équipe (de 0,05 à 1,5) et réduit drastiquement les HP et l\'ATK des personnages qui ne sont pas de classe Cogneur.', 'Foret', 'https://i.imgur.com/wmmU0CO.png', 'wmmU0CO', 'https://onepiecetreasurecruise.fr/Foret/Soleil.html', 'Soleil'),
(20, 'Navire de l\'équipage de Don Quijote', 'Multiplie l\'ATK des personnages de classe Ambitieux par 1,5, les HP par 1,35 et rend le timing des coups “PARFAIT” plus facile pour les personnages de classe Ambitieux.<br><br>Coup spécial (15 tours) : Ajoute 0,2 au multiplicateur de combos pendant 2 tours.', 'Foret', 'https://i.imgur.com/nnpslig.png', 'nnpslig', 'https://onepiecetreasurecruise.fr/Foret/Demon_celeste.html', 'Doflamingo'),
(21, 'Rocketman', 'Multiplie l\'ATK des personnages de classe Tenace par 1,55, réduit drastiquement les HP des personnages qui ne sont pas de classe Tenace et restaure des HP à la fin de chaque tour selon le nombre de personnages de classe Tenace présents dans l\'équipe (de 1 HP à 900 HP).<br><br>Coup spécial (17 tours) : Inflige 99 999 points de dégâts non élémentaires sur un ennemi.', 'Rayleigh', 'https://i.imgur.com/jYDFwb3.png', 'jYDFwb3', '0', 'Rocketman'),
(22, '<small>Figure héroïque de la guerre au sommet</small><br>Moby Dick', 'Multiplie les HP de tous les personnages par 1,3.<br><br>Pendant l\'événement : Multiplie l\'ATK de tous les personnages par 1,5, les HP par 1,4 et enlève 4% des HP de tous les ennemis à la fin de chaque tour.<br><br>Coup spécial (18 tours) : Enlève 20% des HP de chaque ennemi.', 'Evenement', 'https://i.imgur.com/jHF5DgE.png', 'jHF5DgE', '0', 'Guerre'),
(23, 'Navire de Garp', 'Multiplie l\'ATK des personnages de type <b style=\'color:#DC241C\'>STR</font></b> et <b style=\'color:#ECAC04\'>PSY</font></b> par 1,5 et les HP par 1,25.', 'Rayleigh', 'https://i.imgur.com/eoLxt4U.png', 'eoLxt4U', '0', 'Garp'),
(24, 'Polar Tang', 'Multiplie l\'ATK des personnages de classe Sabreur et Libre par 1,5, les HP par 1,25 et rend le timing des coups “PARFAIT” légèrement plus facile pour les personnages de classe Sabreur et Libre.<br><br>Coup spécial (18 tours) : Restaure 10 000 HP si les HP sont en-dessous de 20%.', 'Foret', 'https://i.imgur.com/faEqaEG.png', 'faEqaEG', 'https://onepiecetreasurecruise.fr/Foret/Room.html', 'Polar'),
(25, '<small>Banquet de Grand Line</small><br>Big Top', 'Multiplie l\'ATK des personnages ayant un coût inférieur ou égal à 20 par 1,2.<br><br>Pendant l\'événement : Multiplie l\'ATK de tous les personnages par 1,5, l\'EXP gagnée par 1,5 et les berrys gagnés par 1,5.', 'Evenement', 'https://i.imgur.com/5kZAhaY.png', '5kZAhaY', '0', 'Banquet'),
(26, '<small>Navire revêtu</small><br>Thousand Sunny', 'Multiplie l\'ATK de tous les personnages par 1,5.<br><br>Coup spécial (16 tours) : Réduit les dégâts subis de 50% pendant un tour.', 'Histoire', 'https://i.imgur.com/5iMU76c.png', '5iMU76c', '0', 'Revetu'),
(27, '<small>Panique sur l\'archipel des Sabaody</small><br>Boulet de canon du débarquement et de la déclaration de guerre de Kizaru', 'Réduit le temps de chargement des coups spéciaux des personnages de classe Tireur de 2 tours au début de la quête, multiplie l\'ATK des personnages de classe Tireur par 1,55 et les HP par 1,2.<br><br>Coup spécial (15 tours) : Enlève 7% des HP de chaque ennemi.', 'Foret', 'https://i.imgur.com/i08c5M9.png', 'i08c5M9', 'https://onepiecetreasurecruise.fr/Foret/Singe.html', 'Kizaru'),
(28, 'Vogue M\'sieur Luffy', 'Réduit le temps de chargement des coups spéciaux des personnages de classe Ravageur d\'un tour au début de la quête et si l\'équipe contient 6 personnages de classe Ravageur, multiplie l\'ATK des personnages de classe Ravageur par 1,5 et les HP par 1,2.<br><br>Coup spécial (17 tours) : Réduit drastiquement la partie des dégâts infligés par chaque ennemi qui excède 10 000 pendant un tour.', 'Rayleigh', 'https://i.imgur.com/WKgGHrw.png', 'WKgGHrw', '0', 'Bartolomeo'),
(29, 'Thriller Bark', 'Multiplie l\'ATK des personnages de type <b style=\'color:#1CAC24\'>DEX</font></b> et <b style=\'color:#A916B6\'>INT</font></b> par 1,5 et les HP par 1,25.', 'Rayleigh', 'https://i.imgur.com/0IkAahH.png', '0IkAahH', '0', 'Thriller'),
(30, 'Le Corbeau', 'Multiplie l\'ATK des personnages de classe Tireur par 1,2.<br><br>Coup spécial (16 tours) : Retarde toutes les attaques ennemies d\'un tour.<br><br>Pendant l\'événement : Multiplie l\'ATK et les HP des personnages de classe Tireur uniquement par 2, multiplie l\'ATK des autres personnages par 1,5 et les HP par 1,02.<br><br>Coup spécial (12 tours) : Retarde toutes les attaques ennemies de 2 tours.', 'Evenement', 'https://i.imgur.com/Ce9Jr7E.png', 'Ce9Jr7E', '0', 'Corbeau'),
(31, '<small>Modèle spécial commémoratif</small><br>Thousand Sunny', 'Multiplie l\'ATK de tous les personnages par 1,2.<br><br>Pendant l\'événement (1ère version) : Multiplie l\'ATK de tous les personnages par 1,5 et l\'EXP gagnée par 3.<br><br>Pendant l\'événement (2ème version) : Multiplie l\'ATK de tous les personnages par 1,5 et jauges de chargement des coups spéciaux au maximum au début de la quête.', 'Evenement', 'https://i.imgur.com/Z8nP45r.png', 'Z8nP45r', '0', 'Special'),
(32, 'Hollandais Volant', 'Multiplie l\'ATK de tous les personnages par 1,5 et l\'EXP gagnée par 1,5.<br><br>Coup spécial (16 tours) : Réduit de 25% la défense de tous les ennemis pendant un tour.', 'Rayleigh', 'https://i.imgur.com/2SJMXAr.png', '2SJMXAr', '0', 'Hollandais'),
(33, 'Navire pirate de Marshall D. Teach', 'Réduit le temps de chargement des coups spéciaux de tous les personnages d\'un tour au début de la quête, multiplie les HP de tous les personnages par 1,25 et si l\'équipe contient un personnage de classe Cogneur, un de classe Sabreur, un de classe Tireur et un de classe Ravageur, multiplie l\'ATK de tous les personnages par 1,55.', 'Foret', 'https://i.imgur.com/W15hj8s.png', 'W15hj8s', 'https://onepiecetreasurecruise.fr/Foret/Tenebres.html', 'Teach'),
(34, 'Oiseau noir de l\'Armée révolutionnaire', 'Réduit le temps de chargement des coups spéciaux de tous les personnages d\'un tour au début de la quête, multiplie les HP de tous les personnages par 1,2 et si l\'équipe contient un personnage de type <b style=\'color:#DC241C\'>STR</b>, un de type <b style=\'color:#1CAC24\'>DEX</b> et un de type <b style=\'color:#4C4CFF\'>QCK</b>, multiplie l\'ATK des personnages de type <b style=\'color:#DC241C\'>STR</b>, <b style=\'color:#1CAC24\'>DEX</b> et <b style=\'color:#4C4CFF\'>QCK</b> par 1,55.', 'Rayleigh', 'https://i.imgur.com/SsJYZY9.png', 'SsJYZY9', '0', 'Revolutionnaire'),
(35, 'Zunesh', 'Multiplie l\'ATK des personnages de classe Tenace et Intellectuel par 1,55, les HP par 1,25, rend les cercles <b style=\'color:#BC5C0C\'>[RCV]</b> et <b style=\'color:peru\'>[TND]</b> avantageux pour les personnages de classe Tenace et Intellectuel et rend le timing des coups “PARFAIT” grandement plus facile pour tous les personnages.', 'Deblocable', 'https://i.imgur.com/mX59Mbc.png', 'mX59Mbc', '0', 'Zunesh'),
(36, 'Sexy Foxy', 'Multiplie l\'ATK de tous les personnages par 1,5, l\'EXP gagnée par 1,2 et les berrys gagnés par 2.', 'Rayleigh', 'https://i.imgur.com/0syYA9m.png', '0syYA9m', '0', 'Foxy'),
(37, 'Laboon', 'Multiplie l\'ATK de tous les personnages par 1,2.<br><br>Pendant l\'événement : Multiplie l\'ATK de tous les personnages par 1,5 et jauges de chargement des coups spéciaux au maximum au début de la quête.', 'Evenement', 'https://i.imgur.com/Fpxz6tw.png', 'Fpxz6tw', '0', 'Laboon'),
(38, '<small>Modèle spécial 4e anniversaire de Treasure Cruise</small><br>Thousand Sunny', 'Multiplie l\'ATK de tous les personnages par 1,2.<br><br>Pendant l\'événement (1ère version) : Multiplie l\'ATK de tous les personnages par 1,5 et l\'EXP et les berrys gagnés par 3.<br><br>Pendant l\'événement (2ème version) : Multiplie l\'ATK de tous les personnages par 1,5 et jauges de chargement des coups spéciaux au maximum au début de la quête.', 'Evenement', 'https://i.imgur.com/rTDKygN.png', 'rTDKygN', '0', 'Anniv'),
(39, 'Nostra Castello', 'Multiplie l\'ATK de tous les personnages par 1,55, les HP par 1,3, rend le timing des coups “PARFAIT” légèrement plus facile pour tous les personnages, enlève 3% des HP de tous les ennemis à la fin de chaque tour et si l\'équipe contient un personnage de classe Sabreur, un de classe Libre ou un de classe Tenace, réduit l\'ATK de tous les personnages de 50%.', 'Foret', 'https://i.imgur.com/VOIsApM.png', 'VOIsApM', 'https://onepiecetreasurecruise.fr/Foret/Gang.html', 'Nostra'),
(40, 'Queen Mamma Chanteur', 'Multiplie les HP de tous les personnages par 1,2, augmente les chances d\'apparition des cercles correspondants et si le capitaine est de classe Ambitieux ou Tenace, multiplie l\'ATK des personnages de type <b style=\'color:#DC241C\'>STR</b>, <b style=\'color:#1CAC24\'>DEX</b> et <b style=\'color:#4C4CFF\'>QCK</b> par 1,5, puis par 1,65 après 3 “PARFAIT” d\'affilée.<br><br>Coup spécial (6 tours) : Change le cercle du personnage à droite sur la rangée du bas en cercle <b style=\'color:#BC5C0C\'>[RCV]</b> (6 tours).', 'Foret', 'https://i.imgur.com/wCGoGuE.png', 'wCGoGuE', 'https://onepiecetreasurecruise.fr/Foret/Mamma.html', 'Mamma'),
(41, 'Bateau des Germa 66', 'Si l\'équipe contient un personnage de chaque type, réduit le temps de chargement des coups spéciaux de tous les personnages de 2 tours au début de la quête, multiplie les HP de tous les personnages par 1,25, rend le timing des coups “PARFAIT” légèrement plus facile pour tous les personnages et multiplie l\'ATK de tous les personnages par 1,705 s\'ils ont un cercle <b style=\'color:#BC5C0C\'>[RCV]</b> ou <b style=\'color:peru\'>[TND]</b>, sinon par 1,55.', 'Deblocable', 'https://i.imgur.com/jVV7Gqv.png', 'jVV7Gqv', '0', 'Germa'),
(42, '<small>Modèle spécial 5e anniversaire de Treasure Cruise</small><br>Vogue Merry', 'Multiplie l\'ATK de tous les personnages par 1,2.<br><br>Pendant l\'événement (1ère version) : Multiplie l\'ATK de tous les personnages par 1,5 et l\'EXP et les berrys gagnés par 3.<br><br>Pendant l\'événement (2ème version) : Multiplie l\'ATK de tous les personnages par 1,5 et jauges de chargement des coups spéciaux au maximum au début de la quête.', 'Evenement', 'https://i.imgur.com/UNvzRZk.png', 'UNvzRZk', '0', 'Annif'),
(43, 'Hoé', 'Réduit le temps de chargement des coups spéciaux de tous les personnages d\'un tour au début de la quête, multiplie l\'ATK de tous les personnages par 1,5 et l\'EXP gagnée par 1,75.<br><br>Coup spécial (15 tours) : Restaure 3 500 HP à la fin de chaque tour pendant 2 tours.', 'Deblocable', 'https://i.imgur.com/3Ute6Ru.png', '3Ute6Ru', '0', 'Hoe'),
(44, 'Mégalo', 'Multiplie les HP de tous les personnages par 1,25 et si le capitaine est un personnage de type <b style=\'color:#ECAC04\'>PSY</b> ou <b style=\'color:#A916B6\'>INT</b>, multiplie l\'ATK de tous les personnages par 1,5, ajoute 200 à la RCV du capitaine et réduit les dégâts subis de 10%.<br><br>Coup spécial (8 tours) : Bloque les cercles pendant un tour.', 'Deblocable', 'https://i.imgur.com/LYKPnIN.png', 'LYKPnIN', '0', 'Megalo'),
(45, 'Modèle volant<br>Thousand Sunny', 'Multiplie l\'ATK de tous les personnages par 1,2.<br><br>Pendant l\'événement : Multiplie l\'ATK de tous les personnages par 1,5 et l\'EXP gagnée par 1,5.', 'Evenement', 'https://i.imgur.com/3mlfp0f.png', '3mlfp0f', '0', 'Stampede'),
(46, 'Peace of Spadil', 'Multiplie l\'ATK des personnages de classe Tenace, Libre et Cogneur par 1,6 si les HP sont en-dessous de 30%, sinon par 1,5, et les HP par 1,2.<br><br>Obtenable en terminant pour la première fois le combat crucial d\'Ace au niveau 11★.', 'Evenement', 'https://i.imgur.com/AsIJkel.png', 'AsIJkel', 'https://onepiecetreasurecruise.fr/Raid/Portgas%20D.%20Ace.html', 'Peace'),
(47, 'Carpes géantes', 'Multiplie l\'ATK des personnages de type <b style=\'color:#4C4CFF\'>QCK</b> et <b style=\'color:#A916B6\'>INT</b> par 1,6 si les HP sont au maximum, sinon par 1,5, les HP par 1,2 et rend les cercles <b style=\'color:#BC5C0C\'>[RCV]</b> avantageux pour les personnages de type <b style=\'color:#4C4CFF\'>QCK</b> et <b style=\'color:#A916B6\'>INT</b>.<br><br>Special (11 tours) : Restaure 5 000 HP et ajoute 0,5 au multiplicateur de combos pendant un tour.', 'Deblocable', 'https://i.imgur.com/HlfJtWl.png', 'HlfJtWl', '0', 'Carpe'),
(48, 'Grudge Dolph', 'Réduit le temps de chargement des coups spéciaux de tous les personnages d\'un tour au début de la quête, multiplie les HP des personnages de classe Sabreur et Ravageur par 1,25, multiplie l\'ATK des personnages de classe Sabreur et Ravageur par 1,6 s\'ils ont un cercle arc-en-ciel, <b style=\'color:saddlebrown\'>[WA]</b> ou correspondant, sinon par 1,5, et restaure 1 000 HP à la fin de chaque tour.', 'Foret', 'https://i.imgur.com/U1ihZz0.png', 'U1ihZz0', 'https://onepiecetreasurecruise.fr/Foret/Poupees_de_paille.html', 'Grudge'),
(49, 'Derniers instants<br>Vogue Merry', 'Multiplie l\'ATK de tous les personnages par 1,2.<br><br>Pendant l\'événement : Réduit le temps de chargement des coups spéciaux de tous les personnages de 5 tours au début de la quête, multiplie l\'ATK de tous les personnages par 1,5 et rend le timing des coups “PARFAIT” plus facile pour tous les personnages.<br><br>Coup spécial (12 tours) : Restaure 32% des HP maximum de l\'équipe.', 'Evenement', 'https://i.imgur.com/LzONDbp.png', 'LzONDbp', '0', 'Mort'),
(50, 'Shark Superb', 'Si le capitaine est un personnage de type <b style=\'color:#DC241C\'>STR</b>, <b style=\'color:#1CAC24\'>DEX</b> ou <b style=\'color:#4C4CFF\'>QCK</b>, multiplie l\'ATK de tous les personnages par 2, réduit le multiplicateur d\'ATK de 0,07 à la fin de chaque tour, réduit le temps de chargement des coups spéciaux de tous les personnages d\'un tour au début de la quête et rend le timing des coups “PARFAIT” plus facile pour tous les personnages.', 'Deblocable', 'https://i.imgur.com/YFrPT42.png', 'YFrPT42', '0', 'Shark'),
(51, '<small>Modèle spécial 6e anniversaire de Treasure Cruise</small><br>Thousand Sunny', 'Multiplie l\'ATK de tous les personnages par 1,2.<br><br>Pendant l\'événement : Réduit le temps de chargement des coups spéciaux de tous les personnages de 5 tours au début de la quête, multiplie l\'ATK de tous les personnages par 1,5 et l\'EXP gagnée par 3.', 'Evenement', 'https://i.imgur.com/fpfNLkh.png', 'fpfNLkh', '0', 'AnniG'),
(52, 'Victoria Punk', 'Multiplie les HP de tous les personnages par 1,2, augmente légèrement les chances d\'apparition des cercles <b style=\'color:peru\'>[TND]</b> et si le capitaine est un personnage de type <b style=\'color:#DC241C\'>STR</b> ou <b style=\'color:#1CAC24\'>DEX</b>, multiplie l\'ATK de tous les personnages par 1,65 s\'ils ont un cercle <b style=\'color:peru\'>[TND]</b>, <b style=\'color:maroon\'>[BOMB]</b>, <b style=\'color:maroon\'>[BOMB+]</b> ou <b style=\'color:saddlebrown\'>[WA]</b>, sinon par 1,55.<br><br>Coup spécial (10 tours) : Réduit la durée des barrières dont bénéficient les ennemis d\'un tour.', 'Foret', 'https://i.imgur.com/xPZYIfd.png', 'xPZYIfd', 'https://onepiecetreasurecruise.fr/Foret/Magnetique.html', 'Victoria'),
(53, 'Liberal Hind', 'Réduit le temps de chargement des coups spéciaux de tous les personnages d\'un tour au début de la quête, ajoute 500 à la RCV du capitaine et restaure 1 000 HP à la fin de chaque tour. Si le capitaine est un personnage de classe Libre, Sabreur ou Intellectuel, multiplie l\'ATK de tous les personnages par 1,76 si l\'équipe contient 6 personnages de type <b style=\'color:#ECAC04\'>PSY</b>, sinon par 1,6.<br><br>Coup spécial (10 tours) : Réduit le temps de chargement des coups spéciaux des personnages de type <b style=\'color:#ECAC04\'>PSY</b> d\'un tour.', 'Deblocable', 'https://i.imgur.com/G3Jn5NO.png', 'G3Jn5NO', '0', 'Liberal'),
(54, 'Nostra Castello amphibie', 'Réduit le temps de chargement des coups spéciaux de tous les personnages d\'un tour au début de la quête, multiplie les HP des personnages de type <b style=\'color:#DC241C\'>STR</b>, <b style=\'color:#ECAC04\'>PSY</b> et <b style=\'color:#A916B6\'>INT</b> par 1,4 et si les HP sont au maximum ou en-dessous de 30%, multiplie l\'ATK des personnages de type <b style=\'color:#DC241C\'>STR</b>, <b style=\'color:#ECAC04\'>PSY</b> et <b style=\'color:#A916B6\'>INT</b> par 1,7, sinon par 1,55.', 'Deblocable', 'https://i.imgur.com/rmbDtIi.png', 'rmbDtIi', '0', 'Amphibie'),
(55, 'Oro Jackson', 'Réduit le temps de chargement des coups spéciaux de tous les personnages d\'un tour au début de la quête, multiplie l\'ATK des personnages de classe Libre et Sabreur par 1,6, les HP par 1,3, rend les cercles <b style=\'color:#BC5C0C\'>[RCV]</b> et <b style=\'color:peru\'>[TND]</b> avantageux pour tous les personnages, rend le timing des coups “PARFAIT” plus facile pour tous les personnages et restaure 1 000 HP à la fin de chaque tour.<br><br>Coup spécial (9 tours) : Réduit la durée de “Paralysie” de 2 tours.', 'Deblocable', 'https://i.imgur.com/vktlYR7.png', 'vktlYR7', '0', 'Oro');
